import React from "react";
import Header from "./Header";
import Createnote from "./Createnote";
import Footer from "./Footer";
import Note from "./Note";
const App = () => {
  const addnote = () => {
    alert("i am clicked");
  };
  return (
    <>
      <Header />
      <Createnote passnote={addnote} />
      <Note />
      <Footer />
    </>
  );
};

export default App;
